const menuContainer = document.getElementById('menu-items');
const cartContainer = document.getElementById('cart-items');
const totalAmountEl = document.getElementById('total-amount');
const discountInput = document.getElementById('discount');
const placeOrderBtn = document.getElementById('place-order');

let cart = {};

// Render menu
function renderMenu() {
    menuContainer.innerHTML = '';

    dishes.forEach(dish => {
        const div = document.createElement('div');
        div.classList.add('menu-item');
        div.innerHTML = `
      <img src="${dish.image}" alt="${dish.name}" />
      <h4>${dish.name}</h4>
      <p class="price">Rs ${dish.price}</p>
      <div class="quantity-container">
        <button class="qty-btn" data-action="decrease" data-id="${dish.id}">-</button>
        <input type="number" min="1" value="1"class="quantity-input" data-id="${dish.id}" />
        <button class="qty-btn" data-action="increase" data-id="${dish.id}">+</button>
      </div>
      <button class="add-to-cart" data-id="${dish.id}">Add to Cart</button>
    `;
        menuContainer.appendChild(div);
    });
}

// Render cart
function renderCart() {
    cartContainer.innerHTML = '';

    const cartItems = Object.values(cart);
    if (cartItems.length === 0) {
        cartContainer.innerHTML = '<p>Your cart is empty.</p>';
        totalAmountEl.textContent = '0.00';
        return;
    }

    cartItems.forEach(item => {
        const div = document.createElement('div');
        div.classList.add('cart-item');
        div.innerHTML = `
      <div class="cart-item-name">${item.name}</div>
      <div class="cart-item-details">
        <div class="cart-item-qty">
          <button class="qty-btn" data-action="decrease" data-id="${item.id}">-</button>
          <input type="number" min="1" value="${item.quantity}" class="cart-quantity-input" data-id="${item.id}" />
          <button class="qty-btn" data-action="increase" data-id="${item.id}">+</button>
        </div>
        <div class="cart-item-price">Rs ${item.price * item.quantity}</div>
      </div>
    `;
        cartContainer.appendChild(div);
    });

    updateTotal();
}

// Update total with discount
function updateTotal() {
    let sum = 0;
    Object.values(cart).forEach(item => {
        sum += item.price * item.quantity;
    });

    let discount = parseFloat(discountInput.value) || 0;
    if (discount < 0) discount = 0;
    if (discount > sum) discount = sum;

    const finalTotal = sum - discount;
    totalAmountEl.textContent = finalTotal.toFixed(2);
}

// Add item to cart or update quantity
function addToCart(id, quantity) {
    const dish = dishes.find(d => d.id === id);
    if (!dish) return;

    if (cart[id]) {
        cart[id].quantity += quantity;
    } else {
        cart[id] = {
            ...dish,
            quantity: quantity,
        };
    }
    if (cart[id].quantity < 1) {
        delete cart[id];
    }
}

// Event Listeners
menuContainer.addEventListener('click', e => {
    if (e.target.classList.contains('qty-btn')) {
        const id = Number(e.target.dataset.id);
        const action = e.target.dataset.action;
        const input = e.target.parentElement.querySelector('input.quantity-input');
        let currentQty = Number(input.value);

        if (action === 'increase') {
            currentQty++;
        } else if (action === 'decrease' && currentQty > 1) {
            currentQty--;
        }
        input.value = currentQty;
    }

    if (e.target.classList.contains('add-to-cart')) {
        const id = Number(e.target.dataset.id);
        const quantityInput = e.target.parentElement.querySelector('input.quantity-input');
        const quantity = Math.max(1, Number(quantityInput.value));
        addToCart(id, quantity);
        renderCart();
    }
});

menuContainer.addEventListener('input', e => {
    if (e.target.classList.contains('quantity-input')) {
        if (e.target.value < 1) e.target.value = 1;
    }
});

cartContainer.addEventListener('click', e => {
    if (e.target.classList.contains('qty-btn')) {
        const id = Number(e.target.dataset.id);
        const action = e.target.dataset.action;

        if (!cart[id]) return;

        if (action === 'increase') {
            cart[id].quantity++;
        } else if (action === 'decrease') {
            cart[id].quantity--;
            if (cart[id].quantity < 1) delete cart[id];
        }
        renderCart();
    }
});

cartContainer.addEventListener('input', e => {
    if (e.target.classList.contains('cart-quantity-input')) {
        const id = Number(e.target.dataset.id);
        let qty = Number(e.target.value);
        if (qty < 1) qty = 1;
        if (cart[id]) {
            cart[id].quantity = qty;
            renderCart();
        }
    }
});

discountInput.addEventListener('input', () => {
    updateTotal();
});

placeOrderBtn.addEventListener('click', () => {
    if (Object.keys(cart).length === 0) {
        alert('Your cart is empty! Please add some dishes.');
        return;
    }
    alert(`Thank you for your order! Total amount to pay: Rs ${totalAmountEl.textContent}`);
    // Reset cart & discount
    cart = {};
    discountInput.value = 0;
    renderCart();
    updateTotal();
});

// Initial render
renderMenu();
renderCart();

constcart = {}; // Cart object to store items and quantities

function updateCartUI() {
    const cartItemsDiv = document.getElementById('cart-items');
    const cartTotalSpan = document.getElementById('cart-total');

    cartItemsDiv.innerHTML = ''; // Clear previous cart items
    let total = 0;

    for (const [itemName, itemData] of Object.entries(cart)) {
        const itemTotal = itemData.price * itemData.quantity;
        total += itemTotal;

        const itemDiv = document.createElement('div');
        itemDiv.textContent = `${itemName} - Quantity: ${itemData.quantity} - Rs ${itemTotal}`;
        cartItemsDiv.appendChild(itemDiv);
    }

    cartTotalSpan.textContent = total.toFixed(2);
}

// Event delegation for Add to Cart buttons
document.querySelectorAll('.menu-item').forEach(menuItem => {
    menuItem.querySelector('.add-to-cart').addEventListener('click', () => {
        const name = menuItem.dataset.name;
        const price = parseFloat(menuItem.dataset.price);
        const quantityInput = menuItem.querySelector('.quantity');
        let quantity = parseInt(quantityInput.value);

        if (!quantity || quantity < 1) {
            quantity = 1;
            quantityInput.value = 1;
        }

        // If item already in cart, update quantity, else add new
        if (cart[name]) {
            cart[name].quantity += quantity;
        } else {
            cart[name] = { price, quantity };
        }

        updateCartUI();
    });

    // Plus and minus buttons functionality
    menuItem.querySelector('.plus').addEventListener('click', () => {
        let val = parseInt(menuItem.querySelector('.quantity').value) || 1;
        menuItem.querySelector('.quantity').value = val + 1;
    });

    menuItem.querySelector('.minus').addEventListener('click', () => {
        let val = parseInt(menuItem.querySelector('.quantity').value) || 1;
        if (val > 1) menuItem.querySelector('.quantity').value = val - 1;
    });
});

